import React from 'react';

function LinhaDoTempo() {
  const eventos = [
    { ano: "2018", descricao: "Nos conhecemos", detalhe: "Foi um encontro inesperado em uma cafeteria local."},
    { ano: "2019", descricao: "Primeira viagem juntos", detalhe: "Viagem inesquecível para a praia."},
    { ano: "2020", descricao: "Adotamos nosso pet", detalhe: "O dia em que o Charlie chegou em nossas vidas."},
    // Adicione mais eventos conforme necessário
  ];

  return (
    <div className="bg-white text-center p-4">
      <h2 className="text-2xl font-bold mb-4">Nossa Linha do Tempo</h2>
      <div className="space-y-4">
        {eventos.map((evento, index) => (
          <div key={index} className="p-4 shadow rounded-lg">
            <h3 className="text-xl font-semibold">{evento.ano}</h3>
            <p className="text-gray-800">{evento.descricao}</p>
            <small>{evento.detalhe}</small>
          </div>
        ))}
      </div>
    </div>
  );
}

export default LinhaDoTempo;
